Hi Bhaddani I totally totally aunderstand!!  I'm feeling the so much better today you can't believe I really had fun so far this weekend )

If you have a chance you can go to my resuquest for comment and leave a note and such if you want.

"The question is WHY must I be allowed to edit posthaste rather than, as the drooling imbecile below instructs me, to ""wait it out.""  Quite simply, there are URGENT questions on the Reference Desk that require my immediate attention.  If I don't attend to them now, I fear that lesser, misguided and occasionally malicious editors will respond to these questions and give people the WRONG ANSWER.  This may be hard for you to believe, but I could barely sleep last night worrying about the tidal wave of misinformation that has engulfed the Miscellaneous and Humanities sections of the Reference Desk since I was blocked.  I need to help those poor people NOW.   The reason I was blocked had nothing to do with my sterling and award-winning assistance at the Reference Desk; I was blocked for my naughty (but, in my view, entirely warranted) behavior at AN/I.  I have already given you my word that I do not plan to mix it up at the MORONIC incidents board (for at least a couple weeks) but want only to assist my fellow man and impart my wisdom and knowledge at the Reference Desk as well as make minor edits to articles with mistakes them.  It is URGENT.
Also, I am free all day today (Tuesday), but tomorrow I have plans to go out for pizza and to clean my house and after that I have houseguests, so I won't have much time to edit Wikipedia if I wait for my block to expire.  Now that I have explained myself, I expect you to clarify your response to my unblock request as well.  Please unblock me immediately.  Regards, TFM.}}

"

"

Yet another triumph for the forces of darkness at Wikipedia. I also note again that the erroneous claims and deceit on the part of the editor making the complaint once more go completely unaddressed.

If any editors are interested in how there is a leftist bias prevailing within politics pages at WP, and how this is upheld by Admin when a challenge is made from an editor interested in correcting this, I invite them to look at what has been going on recently at the Roger Scruton page, which now will go on reading like an article that would be written by a left-wing tabloid and not an encyclopedia entry. The pattern, for those who are interested, is as follows:

 Leftist editor posts biased and inaccurate entries on WP politics page based on prejudice and ignorance, or in pursuit of an agenda to discredit a figure on the right of the political spectrum;
 Posts challenged by another editor;
 Leftist editor cannot cope with being challenged and having his ignorance/bias/agenda exposed;
 Leftist editor creates trumped-up (and in the latest example regarding the 3RR violation, in fact completely bogus) charges against the editor that has ""wronged"" him and brings them to admin – a tactic that the ""wronged"" editor knows will result in the ""blocking"" (in effect censorship) of the editor who tried to address the leftist bias.

This is a process of censorship, and the procedure that is gone through at Admin nothing more than a show trial. It is rather ironic that I should see proof positive of this leftist bias at the Scruton page – Scruton has after all himself been vilified by the left throughout his career.   "
